import React from 'react';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Routes>
      <Route>
      path="/temp" element={<TempDrawer />}
      </Route>
    </Routes>
    </>
  );
}

export default App;
